import React from "react";
import { Link } from "react-router-dom";



class QuestionItem extends React.Component {
    render() {
        return (
            <li>
                <span style={{
                    "marginLeft":"50px",
                    "fontSize":"23px"
                }}>{this.props.quest.text}</span>
                 <p>hello</p>
            </li>
        )
    }
}

export default QuestionItem
